INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES ("クリア", 1, 0, 40011, 5, 2, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 325, 24001, 126001);
